# Nizhny, Republic of Bashkortostan

}}
Nizhny (; , Tübänge) is a rural locality (a khutor) in Shingak-Kulsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The rural locality has 2 streets and, as of 2010, a population of 188.
Geography
Nizhny is located 36 km southwest of Chishmy, the district's administrative centre. Yekaterinoslavka is the nearest rural locality.
